import React from "react";

export default function PiData(props){
    let cpu = props.cpu;
    let gpu = props.gpu;
    let ram = props.ram;
    function getCPUData(){
        return(
            <div>
                CPU Data
            </div>
        )
    };

    function getGPUData(){
        return(
            <div>
                Memory Data
            </div>
        )
    };

    function getRAMData(){
        return(
            <div>
                <h4>Ram Data</h4>
                <h5> { ram } </h5>
            </div>
        )
    };

    return(
        <div>
            <div>
                <h2> { getCPUData() } </h2>
            </div>
            <div>
                <h2> { getGPUData() } </h2>
            </div>
            <div>
                <h2> { getRAMData() } </h2>
            </div>
        </div>
    )
};
